import React from 'react';
import { TextField, Typography, Box, Grid, Button, makeStyles } from "@material-ui/core";

const useStyle = makeStyles({
    header: {
        color: 'white',
        background: "primary",
        padding:'4px',
        borderRadius:'5px'
    }
})
const StudentList = () => {
    const classes = useStyle();
    return (
        <>
            <Grid item md={6} >
                <Box>
                    <Box >
                        <Typography  variant='h5' align='center' className={classes.header} >Student List </Typography>
                    </Box>
                </Box>
            </Grid>
        </>
    );
};

export default StudentList;
